document.addEventListener("DOMContentLoaded",(function(e){(async e=>{try{const a=await wp.apiFetch({path:wp.url.addQueryArgs("lp/v1/orders/statistic"),method:"GET"});"success"===a.status&&a.data?e.innerHTML=a.data:e.innerHTML=`<div class="lp-ajax-message error" style="display:block">${a.message&&a.message}</div>`}catch(a){e.innerHTML+=`<div class="lp-ajax-message error" style="display:block">${a.message&&a.message}</div>`}})(document.querySelector("ul.lp_append_data"))}));